import styles from "./Project.module.css";

const ProjectDetial = (props) => {
  return (
    <article>
      <div className={styles.info_cover}>
        <h3 className="font-md font-regular">{props.title}</h3>
        <p className="font-gray">{props.content}</p>
      </div>
    </article>
  );
};

export default ProjectDetial;
